    public String dataGenerator(int xAmount, String properties){
        String[] propertiesArray = properties.split(",");

        String resultJSON = "{\"persons\":[";

        for (int i = 0; i < xAmount; i++) {
            resultJSON += "{";
            for (int j = 0; j < propertiesArray.length; j++) {
                if (propertiesArray[j].equalsIgnoreCase("fname")) {
                    resultJSON += "\"" + propertiesArray[j] + "\"" + ": " + "\"" + getRandomMaleName() + "\"" + ",";
                } else if (propertiesArray[j].equalsIgnoreCase("lname")) {
                    resultJSON += "\"" + propertiesArray[j] + "\"" + ": " + "\"" + getRandomMaleName() + "\"" + ",";
                } else if (propertiesArray[j].equalsIgnoreCase("street")) {
                    resultJSON += "\"" + propertiesArray[j] + "\"" + ": " + "\"" + getRandomStreetInFredensborg() + "\"" + ",";
                } else if (propertiesArray[j].equalsIgnoreCase("city")) {
                    resultJSON += "\"" + propertiesArray[j] + "\"" + ": " + "\"" + "Fredensborg" + "\"" + ",";
                }
            }
            resultJSON = resultJSON.substring(0, resultJSON.length() - 1); //Remove the last comma
            resultJSON += "},";
        }
        resultJSON = resultJSON.substring(0, resultJSON.length() - 1); //Remove the last comma
        resultJSON += "]}";

        return resultJSON;
    }

